import { useState } from 'react'
import {Box, Grid, styled} from '@mui/material'

const GameBoard = styled(Box)({
  width: 300,
  height: 300,
  backgroundColor: 'grey',
})

function App() {

  return (

    <Grid
      container
      spacing={0}
      direction="column"
      alignItems="center"
      justifyContent="center"
      style={{ minHeight: '100vh' }}
    >
      <GameBoard />
    </Grid>
  )
}

export default App;
